import * as React from 'react';
import Link from 'next/link';
import {Bar, Logo} from './styles';
// LogoIcon from '../../asset/icon/logo.png';

interface Props {
	logo: string;
	locations: [];
}

const SideBar = ({logo, locations}: Props) => (
	<Bar>
		<Link href="/">
			<Logo src="/icon/logo.png" />
		</Link>
	</Bar>
);

export default SideBar;
